import React from 'react';
import './App.css';
import HomePage from './HomePage.jsx';
import AboutPage from './AboutPage.jsx';
import SignInPage from './SignInPage.jsx';

function App() {
  return (
    <Routes>
      <Route path="/" element={<HomePage />} />
      <Route path="/signin" element={<SignInPage />} />
    </Routes>
  );
}

export default App;
